import styled from "styled-components";

const AppInput = styled.input`
  height: 26px;
  width: 75px;
  background: rgb(19, 24, 35);
  color: rgb(99, 123, 159);
  border: 1px solid rgb(99, 123, 159);
  font-size: 16px;
  white-space: nowrap;
  appearance: textfield;
  box-shadow: none;
  border-radius: 8px;
  outline: none !important;
  margin: 0;
  font-family: inherit;
  box-sizing: border-box;
  padding: 1px 2px;
`;

export { AppInput };
